use anyhow::Result;
use candle_core::{Tensor, Device, safetensors};

pub struct ScoreModel {
    pub device: Device,
    pub up_proj: Tensor,
    pub bias: Tensor,
    pub down_proj: Tensor,
    pub output_channels: usize
}

impl ScoreModel {
    pub fn score_batch(&self, input: &[f32]) -> Result<Vec<f32>> {
        let d_emb = self.up_proj.shape().dim(1).unwrap();
        let d_hidden =  self.up_proj.shape().dim(0).unwrap();
        let scale = d_emb as f32 / d_hidden as f32;
        let batch_size = input.len() / d_emb;

        let input = Tensor::from_slice(input, (batch_size, d_emb), &self.device)?;

        let hidden_state = self.up_proj.matmul(&input.transpose(0, 1)?)?;
        let hidden_state = hidden_state.add(&self.bias.unsqueeze(1)?.expand((d_hidden, batch_size))?)?;
        let hidden_state = hidden_state.silu()?;
        let outputs = self.down_proj.matmul(&hidden_state)?;
        let mut outputs: Vec<f32> = outputs.transpose(0, 1)?.flatten(0, 1)?.to_vec1()?;

        for x in outputs.iter_mut() {
            *x *= scale;
        }

        Ok(outputs)
    }

    pub fn load(path: &str, gpu: Option<usize>) -> Result<Self> {
        let dev = if let Some(gpu) = gpu {
            Device::new_cuda(gpu)?
        } else {
            Device::Cpu
        };
        let tensors = safetensors::load(path, &dev)?;
        let output_channels = tensors["down_proj"].shape().dim(0).unwrap();
        Ok(Self {
            device: dev,
            up_proj: tensors["up_proj"].clone(),
            bias: tensors["bias"].clone(),
            down_proj: tensors["down_proj"].clone(),
            output_channels
        })
    }
}

